descripcion:
&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; hotel de nueva construcción ubicado en pleno Camino de Santiago próximo a la zona universitaria y hospitalaria de Pamplona, con fácil acceso desde la red de carreteras y la zona industrial. Hotel idóneo para la combinación de ocio y negocios.&lt;br /&gt;&lt;b&gt;Servicios habitaciones: &lt;/b&gt;dispone de habitaciones dotadas con aire acondicionado, baño completo con secador de pelo, TV con más de 20 canales, lámparas especiales de lectura, teléfono y minibar. &lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con garaje cubierto, gimnasio, baño turco gratuito, conexión WIFI a Internet, servicio de lavandería, room servie 24h, bar, restaurante y amplios salones para la celebración de reuniones y convenciones.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; se encuentra situado en un edificio exento, a 5 minutos de Pamplona. Refinado hotel con vistas espectaculares de la cuenca de Pamplona y acceso directo al campo de golf.&lt;br /&gt;&lt;b&gt;Servicios habitaciones:&lt;/b&gt; dispone de 45 habitaciones dobles, una de ellas con salón y un dormitorio indivudal con salón. Todas las habitaciones cuentan con baño completo, TV, teléfono, caja fuerte y minibar.&lt;br /&gt;&lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6465&amp;amp;idRC=6702"&gt;&lt;/a&gt;&lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=1549"&gt;restaurante&lt;/a&gt;&lt;a&gt;&lt;/a&gt;, bar, jardín y terraza.&lt;br /&gt;&lt;b&gt;Otros:&lt;/b&gt; dispone de &lt;a&gt;Spa&lt;/a&gt; para uso de los clientes y del público en general. Cuenta con circuito de agua, sauna, baño turco, sala de relax, cabinas para tratamiento y bañera de hidromasaje.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt;se trata de un edificio tradicional, situado a 5 km del casco urbano de Eugi, pequeña localidad a 27 km de Pamplona y muy cerca de la frontera con Francia. Se encuentra en un enclave en plena naturaleza, junto al embalse del mismo nombre, ideal para descansar y realizar excursiones a los interesantes parajes de los alrededores.&lt;br /&gt;&lt;b&gt;Servicios de habitaciones: &lt;/b&gt;dispone de 4 habitaciones dobles y 1 individual, todas ellas con baño incluido, calefacción y TV.&lt;br /&gt;&lt;b&gt;Servicios del hostal: &lt;/b&gt;cuenta con servicios higiénicos generales para hombres y mujeres, salón con TV, sofas y chimenea y &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso/Restauracion/4794/Arrobi-Borda.htm?idRC=3044"&gt;restaurante&lt;/a&gt; con mirador.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;strong&gt;Ubicación:&lt;/strong&gt; situado en la zona industrial y comercial de la localidad.&lt;br /&gt;
&lt;strong&gt;Servicios habitaciones:&lt;/strong&gt; dispone de 9 habitaciones dobles y 4 triples. Todas las habitaciones tienen incorporado baño de uso exclusivo y están equipadas con teléfono, televisión de plasma, calefacción y climatización.&lt;br /&gt;
&lt;strong&gt;Servicios del hostal:&lt;/strong&gt; cuenta con salón, servicios higiénicos y garaje.&lt;br /&gt;
&lt;strong&gt; &lt;/strong&gt;&lt;br /&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situado en el núcleo urbano en un edificio de viviendas.&lt;br /&gt;
&lt;strong&gt;Servicios habitaciones: &lt;/strong&gt;dispone de 2 habitaciones dobles, 2 individuales y 2 baños a compartir.&lt;br /&gt;
&lt;strong&gt;Servicios de la pensión: &lt;/strong&gt;dispone de salón-comedor.&lt;br /&gt;

&lt;b&gt;Ubicación:&lt;/b&gt; está situado en un edificio de nueva construcción, junto a la estación de servicio de la carretera NA-129 Acedo-Los Arcos-Lodosa, entre las rotondas de salida a la autovía Pamplona-Logroño y la de acceso al polígono industrial.&lt;br /&gt;&lt;b&gt;Servicios de habitaciones:&lt;/b&gt; dispone de 18 habitaciones dobles (3 de ellas con camas de matrimonio) con baño de uso exclusivo, climatización, caja fuerte, TV y teléfono. &lt;br /&gt;&lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con bar-cafetería, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=4986&amp;amp;idRC=3050"&gt;restaurante&lt;/a&gt;, ascensor, tienda, depósito de equipajes y zona Wifi.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; situado a las afueras de Tafalla, junto al velódromo Miguel Indurain.&lt;br /&gt;&lt;b&gt;Servicios habitaciones:&lt;/b&gt; dispone de 52 habitaciones dobles, 2 dobles con salón, 2 dobles adaptadas para discapacitados físicos y 2 habitaciones individuales. Todas las habitaciones tienen incorporado baño de uso exclusivo y están equipadas con televisión, teléfono, climatización y caja fuerte.&lt;br /&gt;&lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con ascensor, bar, cafetería, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=7054&amp;amp;idRC=6956"&gt;restaurante&lt;/a&gt; con 3 salones-comedor adaptables, 2 terrazas, internet, wifi, servicio habitaciones 24 horas, custodia de dinero, depósito de equipajes, tienda de productos agroalimentarios y garaje.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; situado en la muga con Pamplona, junto a la ronda norte, en dirección a la carretera PA-30 que va a San Sebastián y Francia.&lt;br /&gt;&lt;b&gt;Servicios habitaciones:&lt;/b&gt; dispone de 80 apartamentos para 2-4 personas y 3 individuales. Todos dotados con baño, teléfono, caja fuerte, climatización y salón-cocina con TV por satélite.  Algunos de ellos tienen terraza y 2 están adaptados para personas con movilidad reducida.  &lt;br /&gt;&lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con cafetería con terraza, comedor para desayunos, 3 salones para reuniones, conexión Wifi gratuita, ciber corner, lavandería y garaje.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; está situada en un edificio de 2 alturas, a las afueras de &lt;st1:personname productid="la ciudad. Cada"&gt;la localidad junto a la carretera NA 127. &lt;/st1:personname&gt;&lt;br/&gt;
&lt;st1:personname productid="la ciudad. Cada"&gt;&lt;strong&gt;Servicios&lt;/strong&gt; &lt;strong&gt;habitaciones&lt;/strong&gt;: dispone de 2 habitaciones dobles con TV y 2 triples con TV y una de ellas con baño. &lt;/st1:personname&gt;&lt;br/&gt;
&lt;strong&gt;Servicios de la pensión:&lt;/strong&gt; cuenta con sala de estar compartida con los propietarios con chimenea y TV.&lt;br/&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; el establecimiento, de dos alturas, se encuentra en un edificio situado junto a la estación de tren, a unos dos kilómetros del casco urbano de Marcilla. &lt;br /&gt;&lt;b&gt;Servicios de habitaciones:&lt;/b&gt; dispone de 24 habitaciones con baños exclusivos distribuidos en dos plantas. Los dormitorios decorados con sumo cuidado están equipados con minibar gratuito, TV, conexión a internet o caja de seguridad sin cargo. El establecimiento ofrece 22 habitaciones dobles, 1 doble con salón y 1 individual con salón.&lt;br /&gt;&lt;b&gt;Servicios del hotel:&lt;/b&gt; cuenta con recepción, cafetería, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=1497"&gt;restaurante&lt;/a&gt;, sala de reuniones y una zona ajardinada para poder relajarse dándose un agradable paseo.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt;situado a las afueras de la localidad, junto a la carretera N-232.&lt;br /&gt;&lt;b&gt;Servicios habitaciones: &lt;/b&gt;confortables habitaciones equipadas con baño completo, aire acondicionado o calefacción individual, TV y teléfono.&lt;br /&gt;&lt;b&gt;Servicios del hotel: &lt;/b&gt;cuenta con parking exterior, cafetería, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso/Restauracion/191/Bed4U-Castejon.htm?idRC=2973"&gt;restaurante&lt;/a&gt; con servicio buffet y una amplia gama de platos, sala de reuniones con servicios audiovisuales, conexión WIFI a Internet y salones de banquetes.&lt;br /&gt;
 &lt;br /&gt;
*Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt;forma parte del complejo hotelero-termal Baños de Fitero y se halla ubicado en un entorno natural, con un clima privilegiado.&lt;br /&gt;&lt;b&gt;Servicios habitaciones: &lt;/b&gt;habitaciones exteriores con TV con parabólica, teléfono e hilo musical.&lt;br /&gt;&lt;b&gt;Servicios del hotel: &lt;/b&gt;dispone de parking y garaje cubierto, piscinas termales, gimnasio, sauna, jacuzzi, tenis, frontón, salones para la celebración de eventos, bar, cafetería, restaurante para los alojados y jardines. Técnicas termales y servicio médico.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br&gt;&lt;strong&gt;Ubicación: &lt;/strong&gt;establecimiento situado en un edificio reformado situado en el núcleo urbano.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;se compone de 2 habitaciones dobles con baño incorporado y 7 habitaciones múltiples con distinto nº de plazas distribuidas en literas y baño incorporado.&lt;br/&gt;
&lt;strong&gt;Instalaciones: &lt;/strong&gt;sala, sala de usos múltiples, cocina-office, patio y lavandería.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; establecimiento situado en 2 edificios contiguos rehabilitados en el núcleo urbano de Zubiri (200 habitantes) a los pies del Camino de Santiago.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; se compone de 2 habitaciones múltiples con distinto nº de plazas distribuidas en literas. Los servicios higiénicos incluyen 4 duchas, 3 inodoros y 6 lavabos.&lt;br/&gt;
&lt;b&gt;Instalaciones:&lt;/b&gt; sala-comedor con máquinas de vending y cocina, y zona exterior con merendero al aire libre y tendedero exterior.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación: &lt;/strong&gt;establecimiento situado en el antiguo hospital de peregrinos del siglo XII en el núcleo urbano de Arre, a los pies del Camino de Santiago.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;se compone de 4 habitaciones múltiples con distinto nº de plazas distribuidas en literas. Los servicios higiénicos incluyen 4 duchas, 4 inodoros, 7 lavabos y 2 urinarios.&lt;br/&gt;
&lt;strong&gt;Instalaciones: &lt;/strong&gt;dispone de comedor con cocina incorporada, sala de estar y usos múltiples, aparcamiento para bicicletas y patio exterior amueblado y con tendederos.&lt;br/&gt;
 &lt;br/&gt;
&lt;strong&gt; &lt;/strong&gt;&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; Establecimiento situado en un edificio tradicional en el núcleo urbano de Urzainqui (95 habitantes) en el Valle de Roncal .&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; Planta baja: cuenta con cocina equipada, comedor con chimenea, sala con TV y aseo. 1ª planta: dispone de 2 habitaciones cuádruples , 2 habitaciones dobles y servicios higiénicos con 1 inodoro, 3 lavabos y 3 duchas y en la 3ª planta hay otras 2 habitaciones cuádruples y  2 dobles y servicios higiénicos con 1 inodoro, 3 lavabos y 3 duchas. Todas las habitaciones tienen literas. &lt;br/&gt;
 &lt;br /&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situado a las afueras del núcleo urbano, en una zona de robles cercana a la localidad de Larraintzar.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;se compone de 4 cabañas construidas en las ramas de los árboles que no disponen de agua corriente ni electricidad. Una de las cabañas dispone de 4 plazas y el resto de 2. Todas cuentan con una terraza mirador y baño seco biodegradable. Los servicios higiénicos situados en un edifico de uso comun incluyen 4 duchas, 2 inodoros y 4 lavabos.&lt;br /&gt;
&lt;strong&gt;Instalaciones:&lt;/strong&gt; comedor y sala de usos múltiples.&lt;br /&gt;

&lt;br&gt;&lt;strong&gt;Ubicación: &lt;/strong&gt;albergue de nueva construcción manteniendo la tipología tradicional, situado en el núcleo urbano. Adosado a la vivienda del propietario y al &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=5867"&gt;apartamento turístico Irugoienea&lt;/a&gt;, ocupa el sotano del edificio.
&lt;strong&gt;Distribución:&lt;/strong&gt; se compone de 2 habitaciones múltiples con distinto nº de plazas distribuidas en literas. Los servicios higiénicos incluyen 2 inodoros, 2 duchas y 4 lavabos.&lt;br/&gt;
&lt;b&gt;Instalaciones: &lt;/b&gt;sala-comedor con TV y 2 ordenadores.&lt;br/&gt;
&lt;strong&gt;Otros:&lt;/strong&gt; terraza. &lt;br/&gt;

&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt;establecimiento situado en un edificio en la plaza de Legasa, pequeña localidad de 225 habitantes próxima al valle de Baztan en el Pirineo Atlántico y al Señorío de Bertiz. Es un buen punto de partida para visitar las cuevas de Zugarramurdi o Urdax o hermosos pueblos como Elizondo.&lt;br /&gt;&lt;b&gt;Distribución: &lt;/b&gt;en la planta baja: bar, comedor y aseo. Planta primera: sala de usos múltiples con futbolín, dos dormitorios con baño, uno de 4 plazas y otro de 6 plazas. Planta segunda: tres dormitorios con baño, de 10, 12 y 12 plazas respectivamente. Cuenta con ducha/s y baño/s en cada habitación.&lt;br /&gt;&lt;strong&gt;Otros&lt;/strong&gt;: cuenta con ascensor.&lt;br /&gt;
 &lt;br /&gt;
* Alojamiento con &lt;strong&gt;condiciones de accesibilidad validadas&lt;/strong&gt; por el Gobierno de Navarra.&lt;br /&gt;

&lt;br&gt;&lt;p class="section1"&gt;&lt;strong&gt;Ubicación&lt;/strong&gt;: establecimiento situado, en una casa tradicional rehabilitada, en el núcleo urbano. &lt;o:p&gt;&lt;/o:p&gt;&lt;/br&gt;
&lt;p class="section1"&gt;&lt;strong&gt;Distribución&lt;/strong&gt;: en las planta segunda y bajo cubierta dispone de 12 habitaciones múltiples con distinto nº de plazas distribuidas en literas. Los servicios higiénicos incluyen 12 duchas, 12 inodoros, 4 urinarios y 17 lavabos. En la planta primera se encuetran la sala de usos múltiples, la sala de estar con TV y vídeo y dos aulas.&lt;/br&gt;
&lt;p class="section1"&gt;&lt;strong&gt;Instalaciones&lt;/strong&gt;: Bar-restaurante.&lt;o:p&gt;&lt;/o:p&gt;&lt;/br&gt;
&lt;p class="section1"&gt;&lt;strong&gt;Actividades&lt;/strong&gt;: cursos de euskera.&lt;o:p&gt;&lt;/o:p&gt;&lt;/br&gt;

&lt;br&gt;&lt;b&gt;&lt;b&gt;Situación:&lt;/b&gt; &lt;/b&gt;en el núcleo urbano de la localidad en un edificio de dos plantas.&lt;br/&gt;
&lt;b&gt;Entorno:&lt;/b&gt; situada en Tierra Estella, en pleno Camino de Santiago, conserva las ruinas de su castillo medieval y está rodeada de viñedos y de montes como Montejurra, Lóquiz y las sierras de Urbasa-Andía.&lt;br/&gt;
&lt;b&gt;&lt;b&gt;Distribución:&lt;/b&gt; &lt;/b&gt;planta baja: cuenta con cocina-sala de estar. Primera planta: hay una habitación doble con baño, otra habitación de 6 plazas y 1 baño. Segunda planta: dispone de un dormitorio múltiple para 12 personas. El albergue dispone de 3 inodoros, 3 duchas y 4 lavabos.&lt;br /&gt;&lt;b&gt; &lt;/b&gt;&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; establecimiento situado en un edificio rehabilitado en el núcleo urbano, junto al Parque de la Media Luna.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; se compone de 2 habitaciones dobles y 4 habitaciones múltiples con distinto nº de plazas distribuidas en literas. Los servicios higiénicos incluyen 2 duchas, 2 inodoros y 4 lavabos.&lt;br/&gt;
&lt;b&gt;Instalaciones:&lt;/b&gt; sala de usos múltiples-comedor, cocina y patio con jardín.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; apartamento situado en la planta baja de una casa tradicional reformada en el núcleo urbano, compartiendo edificio con los apartamentos &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso/relacionado/5190/"&gt;Abarra I&lt;/a&gt;, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=5191"&gt;Abarra II&lt;/a&gt; y &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso/relacionado/5192/"&gt;Abarra III&lt;/a&gt;. &lt;br /&gt;&lt;strong&gt;Entorno:&lt;/strong&gt; localidad famosa por su bella iglesia románica de Santiago de Itxasperri. A medio camino entre Vitoria y Pamplona, tiene una ubicación ideal para conocer el Parque Natural de Urbasa-Andía, la cueva de Mendukilo o la sierra de Aralar.&lt;br/&gt;
&lt;strong&gt;Distribución:&lt;/strong&gt; dispone de 1 habitación doble, 1 baño y salón-comedor con TV y cocina incorporada totalmente equipada.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;1 baño y sala de estar común para todos los apartamentos con aparatos de gimnasia y bicicletas estáticas.&lt;br/&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situada en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Entorno&lt;/strong&gt;: Dicastillo es una villa emplazada a los pies de Montejurra, muy cercana a Estella-Lizarra que permite a los visitantes disfrutar de la naturaleza y el arte.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de 1 habitación doble, 1 baño a compartir y salón-comedor con cocina incorporada. Primera planta: cuenta con 1 habitación triple con baño de uso exclusivo, 3 dobles y 1 baño a compartir.&lt;br /&gt;

&lt;strong&gt;Ubicación:&lt;/strong&gt; situado en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;Arguedas es una población situada entre las Bardenas Reales y la Vega del Río Ebro. Es el punto de acceso más importante para los visitantes de La "Bardena Blanca". En este municipio se sitúa el Parque de la Naturaleza "Senda Viva", con atracciones y espectáculos para toda la familia.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 2 habitaciones dobles, salón-comedor con cocina incorporada y 1 baño a compartir.&lt;br /&gt;

&lt;b&gt;Ubicación:&lt;/b&gt; apartamento turístico situado a 10 minutos del centro. Próximo a la Vuelta del Castillo (pulmón verde de la ciudad) y a la estación de autobuses. Paradas de bus y taxis cerca. 
&lt;b&gt; &lt;/b&gt;&lt;br /&gt;
&lt;b&gt;Distribución:&lt;/b&gt; dispone de 2 habitaciones dobles, 1 habitación individual, 2 baños, cocina independiente totalmente equipada, salón-comedor con TV y extraordinarias vistas. Cuenta con plaza de garaje privada.&lt;br /&gt;

&lt;br&gt;&lt;b&gt;Ubicación: c&lt;/b&gt;asa tradicional de 3 plantas situada en el núcleo urbano. Cuenta con 6 apartamentos. El apartamento Barda está en la primera planta.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;Acedo está situado en el valle de la Berrueza, en la Zona Media, entre las sierras de Lókiz y Codés, y cerca tanto del Parque Natural de Urbasa - Andía, como del trazado del Camino de Santiago.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; dispone de cocina-salón-comedor y 1 habitación doble con baño.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación: c&lt;/b&gt;asa tradicional de 3 plantas situada en el núcleo urbano. Cuenta con 6 apartamentos. El apartamento Txoko está en la planta segunda.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;Acedo está situado en el valle de la Berrueza, en la Zona Media, entre las sierras de Lókiz y Codés, y cerca tanto del Parque Natural de Urbasa - Andía, como del trazado del Camino de Santiago.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; dispone de cocina-salón-comedor y 1 habitación doble con baño.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación: c&lt;/b&gt;asa tradicional de 3 plantas situada en el núcleo urbano. Cuenta con 6 apartamentos. El apartamento Txoko está en la primera planta.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;Acedo está situado en el valle de la Berrueza, en la Zona Media, entre las sierras de Lókiz y Codés, y cerca tanto del Parque Natural de Urbasa - Andía, como del trazado del Camino de Santiago.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; dispone de cocina-salón-comedor y 1 habitación doble con baño.&lt;br/&gt;

