&lt;b&gt;Entorno: s&lt;/b&gt;ituada en pleno Camino de Santiago, en una pequeña localidad (x habitantes) rodeada por los bosques frondosos de la Sierra de Aralar, y bien comunicada por la autovía con todas las capitales vascas. Lugar ideal para descansar, realizar senderismo y conocer parajes naturales como el Parque Natural de Urbasa-Andía.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; planta baja: dispone de salón-comedor, cocina equipada con lavavajillas y microondas, 1 habitación doble con baño / y 1 baño. Primera planta: 2 habitaciones dobles con baño (una de ellas adaptada), 2 individuales y 1 baño a compartir. Otros espacios: ático abuhardillado destinado a zona de ocio, con pequeña biblioteca y juegos de mesa. Bodega con billar y mesa de ping-pong. Zona verde de esparcimiento a disposición de los clientes equipada con mesa, bancos, hamacas y barbacoa.&lt;br/&gt;
&lt;b&gt;Servicios: &lt;/b&gt;abundantes desayunos de elaboración propia a base de productos biológicos y naturales. Se dan cenas previo aviso. Se ofrece información turística de &lt;st1:personname productid="la zona. Paseos"&gt;la zona. Paseos&lt;/st1:personname&gt; guiados en sierra&lt;i&gt;s&lt;/i&gt; de Urbasa, Andía etc.&lt;br/&gt;
&lt;b&gt;Agroturismo&lt;/b&gt;&lt;b&gt;:&lt;/b&gt; elaboración de mermeladas, visita a granja de ovejas y degustación de cuajadas.&lt;br/&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; casa de nueva construcción aislada a 1,5km del núcleo urbano. Vivienda independiente.&lt;br /&gt;&lt;b&gt;Entorno:&lt;/b&gt; ideal para conocer el patrimonio de la Valdorba donde abundan muestras del románico rural y descubrir enclaves como el Palacio Real de Olite o el Cerco de Artajona.&lt;br /&gt;&lt;b&gt;Distribución:&lt;/b&gt; planta baja: dispone de salón-comedor con chimenea, barra de bar y televisión, una habitación triple con baño, cocina totalmente equipada y aseo. Primera planta: cuenta con 1 habitación triple, 1 doble, 1 individual, 2 baños a compartir con secador de pelo y sala de estar.&lt;br /&gt;&lt;b&gt;Otros:&lt;/b&gt; terraza, porche con mobiliario y jardín con mobiliario, barbacoa y piscina.&lt;br /&gt;
