&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; casa tradicional reformada situada en el núcleo urbano. Vivienda independiente y adosada a la del propietario. Mantiene la piedra original del edificio.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;pequeño pueblo de 60 habitantes situado a los pies de la sierra de Aralar, desde donde se puede visitar el Santuario de San Miguel de Aralar o la cueva de Mendukilo en Astitz, realizar senderos como la Vía Verde del Plazaola o andar por los árboles en el parque Beigorri de Lekunberri.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 4 habitaciones dobles con baño de uso exclusivo y techo abuhardillado de madera, 1 baño a compartir, salón-comedor con chimenea, TV, DVD y juegos y cocina totalmente equipada.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;wifi y pequeño salón en altillo.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;edificio adosado ubicado en una pequeña urbanización junto al camping Aritzaleku de Lerate.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;situado a orillas del Embalse de Alloz, a los pies de las Sierras de Andía y Urbasa. Se encuentra a escasos minutos al norte de Estella-Lizarra, cerca del Monasterio de Irantzu y a medio camino entre Pamplona y Logroño.&lt;br /&gt;&lt;b&gt;Distribución:&lt;/b&gt; planta baja: dispone de cocina, salón-comedor, 1 habitación doble y 1 baño. Primera planta: 4 habitaciones dobles (una de ellas con baño exclusivo) y 1 baño. Jardín y porche.&lt;br/&gt;
