descripcion:
&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt; se trata de un edificio de 3 plantas en el centro del núcleo urbano.&lt;br /&gt;&lt;b&gt;Entorno: &lt;/b&gt; pequeño pueblo de 178 habitantes situado en el corazón de la Sierra de Codés y próximo al Camino de Santiago. Enclave ideal para visitar localidades como Viana, Torres del Río, Los Arcos o Estella-Lizarra. &lt;br /&gt;&lt;b&gt;Distribución: &lt;/b&gt; planta baja: dispone de salón-comedor con chimenea y libros, cocina con microondas y lavavajillas, sala de estar también con chimenea y juegos, un baño con ducha y un aseo. Primera planta: cuenta con 5 habitaciones dobles, 1 triple y 1 individual, 1 aseo y 3 baños (2 con bañera y 1 con ducha). Segunda planta: hay 3 habitaciones (1 triple, 1 doble y 1 individual) y 1 baño con ducha de hidromasaje. Además cuenta con una terraza a la que se accede desde la primera planta y de un patio con barbacoa. &lt;br /&gt;&lt;b&gt;Otros: &lt;/b&gt; posibilidad de instalar 2 camas supletorias.&lt;br /&gt;
 &lt;br /&gt;
