&lt;strong&gt;Ubicación: &lt;/strong&gt;situado en el núcleo urbano.&lt;br /&gt;
&lt;b&gt;Entorno:&lt;/b&gt; Rada es una localidad de 550 habitantes, situada en la Ribera, a unos pocos kilómetros del &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=3114"&gt;despoblado medieval&lt;/a&gt; de Rada. Desde esta población podemos visitar el Parque Natural de las   Bardenas Reales, el Monasterio de la Oliva y la localidad de Olite.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 3 habitaciones dobles con baño de uso exclusivo, 1 baño a compartir, cocina-comedor y salón con TV.&lt;br /&gt; &lt;strong&gt;Otros: &lt;/strong&gt;patio interior con zona verde y mobiliario.&lt;br /&gt;

&lt;br&gt;&lt;b&gt;Ubicación: c&lt;/b&gt;asa tradicional  situada en el núcleo urbano.&lt;br/&gt;
&lt;b&gt;Entorno: s&lt;/b&gt;ituada en pleno Camino de Santiago, en una pequeña localidad (330 habitantes) muy próxima a Estella-Lizarra y al Monasterio de Iratxe.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; planta baja: dispone de cocina-comedor y aseo. Primera planta: cuenta con  2 habitaciones dobles y un  baño. Planta entrecubierta: 1 habitación doble, 1 baño, salón y cuarto de lavadora.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;casa tradicional reformada  situada en el núcleo urbano. Vivienda adosada a la del propietario ocupando la primera planta de edificio. Rehabilitada manteniendo la madera y la piedra originales.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;pueblo-calle del Pirineo navarro, último foco de resistencia frente a la ocupación de Navarra por la corona de Castilla en cuyo recuerdo se alza un monolito. Lugar idóneo para visitar las cuevas de Urdazubi-Urdax y Zugarramurdi o el parque natural del Señorío de Bertiz.&lt;br/&gt;
&lt;b&gt;Distribución:&lt;/b&gt; dispone de 3 habitaciones dobles, 2 baños a compartir con secador de pelo, zona de estar y salón-comedor con TV y cocina incorporada totalmente equipada.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;terraza con mobiliario.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; casa de moderna construcción situada en el núcleo urbano en un bloque de viviendas adosadas.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;pequeño y tranquilo pueblo de 127 habitantes ubicado a orillas del río Urederra. Entorno ideal para practicar senderismo o visitar enclaves como el nacedero del Urederra, Estella-Lizarra o los monasterios de Iratxe e Irantzu.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de aseo. Primera planta: cuenta con 1 habitación doble, 1 baño a compartir, cocina totalmente equipada y salón-comedor con TV. Segunda planta: ofrece 2 habitaciones dobles, 1 triple y 1 baño a compartir.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;garaje.&lt;br/&gt;
 &lt;br /&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; apartamento adosado de nueva construcción situado en el núcleo urbano.&lt;br/&gt;
&lt;strong&gt;Entorno:&lt;/strong&gt; pequeño pueblo de 29 habitantes situado en el Valle de Yerri desde donde se pueden realizar visitas culturales al casco histórico de Estella-Lizarra o al Monasterio de Irantzu, practicar senderismo en las Sierras de Urbasa o Andía o bañarse y practicar deportes náuticos en el Pantano de Alloz.&lt;br/&gt;
&lt;strong&gt;Distribución:&lt;/strong&gt; sótano: dispone de salón-comedor con TV, DVD y mesa multijuegos. Planta baja: cuenta con un aseo, cocina totalmente equipada y salón. Primera planta: ofrece 1 baño a compartir y 3 habitaciones dobles abuhardilladas, una de ellas  con baño de uso exclusivo, TV, Home cinema y DVD.&lt;br/&gt;
&lt;strong&gt;Otros:&lt;/strong&gt; garaje y jardín.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:&lt;/strong&gt; casa de moderna construcción situada en el núcleo urbano. Vivienda independiente.&lt;br/&gt;
&lt;strong&gt;Entorno:&lt;/strong&gt; localidad de unos 700 habitantes situada en pleno Camino de Santiago, a 2 km. de Puente la Reina y de la Ermita de Eunate. Su plaza de estilo medieval, resulta un marco perfecto para la representación del Misterio de Obanos, leyenda muy ligada al Camino de Santiago que da popularidad a la villa.&lt;br/&gt;
&lt;strong&gt;Distribución:&lt;/strong&gt; planta semisótano: dispone de salón-comedor con cocina incorporada totalmente equipada, chimenea, TV y 1 baño a compartir. Pimera planta: cuenta con 2 habitaciones dobles con TV, 1 baño a compartir y terraza. Segunda planta: ofrece 1 habitación doble con baño de uso exclusivo, TV y terraza.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;parcela con terraza amueblada y pérgola, zona de solarium y cascada con agua. Ascensor para personas discapacitadas exclusivamente.&lt;br/&gt;

&lt;br /&gt;&lt;b&gt;Ubicación:&lt;/b&gt; edificio de dos plantas y bajo cubierta y de arquitectura tradicional de la zona, el apartamento se sitúa en la planta primera y en la planta segunda se encuentra el apartamento Imaz Etxea II. &lt;br /&gt;&lt;b&gt;Entorno:&lt;/b&gt; localidad situada en el corredor del Arakil y nudo de comunicaciones entre Navarra y el País Vasco. Se encuentra a los pies de la sierra de Urbasa y muy próxima a las sierras de Andía y Aralar, con amplias posibilidades para el senderismo. Interesantes visitas culturales al santuario de San Miguel de Aralar o a la ciudad monumental de Estella-Lizarra. &lt;br /&gt;&lt;b&gt;Distribución:&lt;/b&gt; 3 habitaciones dobles, un baño, cocina equipada y salón-comedor con TV. &lt;br /&gt;Servicios: posibilidad de instalar una cama supletoria. English is spoken. On parle français.&lt;br /&gt;
