&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; casa de nueva construcción manteniendo la tipología tradicional, situada en el núcleo urbano.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;pequeño pueblo de 150 habitantes situado en el valle de Malerreka, caracterizado por la abundancia de ríos y regatas, bosques de robles y hayas. Muy próximo al área natural recreativa de los embalses de Leurtza, también se pueden realizar excursiones al Parque Natural de Bertiz o a las cuevas de Zugarramurdi y Urdax.&lt;br/&gt;
&lt;strong&gt;Distribución:&lt;/strong&gt; planta baja: dispone de 1 baño a compartir con secador de pelo y salón-comedor con chimenea, TV, juegos y cocina incorporada totalmente equipada. Primera planta: cuenta con 1 baño a compartir con secador de pelo y 2 habitaciones dobles, una de ellas con TV. Segunda planta: ofrece 1 habitación doble con techo abuhardillado y aseo con secador de pelo.&lt;br/&gt;
&lt;strong&gt;Otros:&lt;/strong&gt; porche con mobiliario.&lt;br/&gt;

&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;apartamento de nueva construcción manteniendo la tipología tradicional, situado en el núcleo urbano. Vivienda adosada a la del propietario y al &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=5868"&gt;albergue Irugoienea&lt;/a&gt;, ocupa la primera planta del edificio.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;Aurizberri/Espinal es un pueblo-calle, surcado por el Camino de Santiago, que ofrece la posibilidad de disfrutar de lugares tan emblemáticos como la Selva de Irati o de la Colegiata de Orreaga/Roncesvalles, entre otros.&lt;br/&gt;
&lt;strong&gt;Distribución:&lt;/strong&gt; dispone de 3 habitaciones dobles con techo abuhardillado de madera, una de ellas de una cama, 1 baño a compartir con secador de pelo y salón-comedor con TV y cocina incorporada totalmente equipada.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;jardín y servicio wifi.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación: &lt;/strong&gt;casa reformada situada en el núcleo urbano. Vivienda independiente que ocupa la totalidad del edificio.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;pequeño pueblo de 48 habitantes situado en el Valle de Yerri desde donde se pueden realizar visitas culturales al casco histórico de Estella-Lizarra o al Monasterio de Irantzu, practicar senderismo en las Sierras de Urbasa o Andía o bañarse y practicar deportes náuticos en el Pantano de Alloz.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de 1 aseo, cocina totalmente equipada, comedor y salón-comedor con TV, DVD, juegos de mesa y libros. Primera planta: cuenta con 1 baño a compartir, 2 habitaciones individuales, 2 dobles y 1 triple. Segunda entreplanta: ofrece 1 habitación individual, 1 doble, 1 baño a compartir y 1 salita. Segunda planta: dispone de 1 habitación individual, 1 doble, 1 triple, 1 baño a compartir, 1 aseo, comedor con TV y cocina totalmente equipada.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;sala (antigua bodega) equipada con mesa de ping-pong, barra y mobiliario; patio con porche, barbacoa y mobiliario.&lt;br/&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situado en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Entorno:&lt;/strong&gt; pequeño pueblo de 170 habitantes, caracterizado por la  abundancia de ríos y regatas, bosques de robles y hayas. Próximo al área  natural recreativa de los embalses de Leurza, se pueden realizar  excursiones al Parque Natural de Bertiz, a las cuevas de Zugarramurdi,  Urdax y a la vía verde del Plazaola.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 2 habitaciones dobles, 1 baño a compartir, cocina y salón-comedor.&lt;br /&gt;&lt;strong&gt;Otros: &lt;/strong&gt;porche con mobiliario y jardín.&lt;br /&gt;

&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;situado en un edificio de viviendas en el núcleo urbano ocupando la primera planta del edificio.&lt;br/&gt;
&lt;strong&gt;Entorno:&lt;/strong&gt; pueblo de 300 habitantes de ambiente pirenaico situado en el valle de Salazar, caracterizado por sus pequeños pueblos de casa blasonadas y tejados fuerte pendiente y sus iglesias románicas y góticas. Muy próximo a la Selva de Irati o al valle de Belagua. &lt;br/&gt;
&lt;b&gt;Distribución: &lt;/b&gt;dispone de 2 habitaciones dobles de dos camas, 1 baño a compartir con secador de pelo, comedor con cocina totalmente equipada y salón con TV.&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación: &lt;/strong&gt;casa tradicional reformada situada en el núcleo urbano. Vivienda adosada a la del propietario.&lt;br/&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;situado en las cercanías de Pamplona, en una pequeña localidad (36 habitantes) rodeada por zonas boscosas. Lugar ideal para descansar, realizar pequeños paseos y conocer el Parque Natural de Urbasa-Andia, el manantial y el Museo Etnográfico de Arteta.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de salón con chimenea, TV, DVD, equipo de música, wifi y comedor con cocina totalmente equipada. Entreplanta: cuenta con 1 baño a compartir. Primera planta: ofrece 2 habitaciones dobles, 1 triple con terraza y 1 baño a compartir con secador de pelo.&lt;br/&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;jardín y porche ambos con mobiliario.&lt;br/&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;se encuentra en la planta baja de en un edificio de viviendas de nueva construcción.&lt;/br&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;pintoresco pueblo fronterizo con Francia, rodeado de los frondosos bosques del Pirineo navarro e inicio del Camino de Santiago.&lt;br /&gt;&lt;strong&gt;Distribución:&lt;/strong&gt; dispone de 1 habitación triple, 1 baño, cocina y salón-comedor.&lt;/br&gt;
 &lt;/br&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situado en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;Olite es una villa de elegante trama urbana en la que destacan numerosas casas blasonadas de los periodos renacentista y barroco. Está situada en el centro de la Zona Media de Navarra, punto de transición entre la Montaña y la Ribera. El pueblo tiene cerca de 3000 habitantes y le han dado fama sobre todo sus vinos y su Castillo-Palacio medieval.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de un patio interior. Primera planta: cuenta con salón, comedor, cocina y 1 baño a compartir. Segunda planta: ofrece 1 habitación doble, 1 triple, 1 baño a compartir y terraza. Tercera planta: dispone de 1 habitación doble y 1 triple.&lt;br /&gt;

&lt;strong&gt;Ubicación&lt;/strong&gt;: cerca de la zona hospitalaria.&lt;br /&gt;
&lt;strong&gt;Distribución&lt;/strong&gt;: cuenta con cocina-salón-comedor, 2 habitaciones dobles, 1 habitación individual y 1 baño.&lt;br /&gt;
 &lt;br /&gt;

&lt;strong&gt;Ubicación:&lt;/strong&gt; situado en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;planta baja: dispone de aseo y salón-comedor con cocina. Primera planta: cuenta con 2 habitaciones dobles y 1 baño a compartir. Segunda planta: ofrece 2 habitaciones dobles y 1 cuádruple y 1 baño a compartir. Tercera planta: cuenta con 1 baño.&lt;br /&gt;
&lt;strong&gt;Otros: &lt;/strong&gt;terraza.&lt;br /&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; en la planta baja de un edificio rehabilitado en el casco urbano.  En el mismo edificio se encuentran los apartamentos &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6792&amp;amp;idRC=6666"&gt;Onki Xin 2&lt;/a&gt; , &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6793&amp;amp;idRC=6667"&gt;Onki Xin 3&lt;/a&gt; y &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6794&amp;amp;idRC=6668"&gt;Onki Xin 4&lt;/a&gt;.&lt;/br&gt;
&lt;br&gt;&lt;b&gt;Entorno:&lt;/b&gt; Isaba es el prototipo de villa pirenaica, coronada por la torre defensiva de su iglesia gótica. Es una población animada, sobre todo en verano y fines de semana, centro de las excursiones a los valles de Belagua y Belabarce.&lt;/br&gt;
&lt;br&gt;&lt;b&gt;Distribución:&lt;/b&gt; dispone de 2 habitaciones dobles, 1 baño y salón-cocina-comedor.&lt;/br&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; en la planta primera de un edificio rehabilitado en el casco urbano.  En el mismo edificio se encuentran los apartamentos &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6547&amp;amp;idRC=6665"&gt;Onki Xin 1&lt;/a&gt;, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6792&amp;amp;idRC=6666"&gt;Onki Xin 2&lt;/a&gt; y &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6794&amp;amp;idRC=6668"&gt;Onki Xin 4&lt;/a&gt;.&lt;/br&gt;
&lt;br&gt;&lt;b&gt;Entorno:&lt;/b&gt; Isaba es el prototipo de villa pirenaica, coronada por la torre defensiva de su iglesia gótica. Es una población animada, sobre todo en verano y fines de semana, centro de las excursiones a los valles de Belagua y Belabarce.&lt;/br&gt;
&lt;br&gt;&lt;b&gt; &lt;/b&gt;&lt;/br&gt;
&lt;br&gt;&lt;b&gt;Distribución:&lt;/b&gt; dispone de 2 habitaciones dobles ,1 baño y salón-cocina-comedor.&lt;/br&gt;

&lt;br&gt;&lt;b&gt;Ubicación:&lt;/b&gt; en la planta primera de un edificio rehabilitado en el casco urbano.  En el mismo edificio se encuentran los apartamentos &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6547&amp;amp;idRC=6665"&gt;Onki Xin 1&lt;/a&gt;, &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6792&amp;amp;idRC=6666"&gt;Onki Xin 2&lt;/a&gt; y &lt;a HREF="http://www.turismo.navarra.es/esp/organice-viaje/recurso.aspx?o=6794&amp;amp;idRC=6668"&gt;Onki Xin 4&lt;/a&gt;.&lt;/br&gt;
