&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;apartamento situado en un edificio de viviendas del núcleo urbano, junto al Planetario y en las proximidades de la Clínica Universitaria.&lt;br/&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 4 habitaciones dobles, una de ellas con baño de uso exclusivo, 2 baños a compartir, cocina totalmente equipada y salón-comedor con TV y terraza.&lt;br/&gt;
&lt;b&gt; &lt;/b&gt;&lt;br/&gt;

&lt;br&gt;&lt;strong&gt;Ubicación:  &lt;/strong&gt;apartamentos situados en un edificio de 6 alturas a las afueras de Pamplona.&lt;br/&gt;
&lt;strong&gt;Distribución: Apartamento 1B: &lt;/strong&gt;dispone de 1 baño, 1 habitación doble, cocina totalmente equipada y salón con TV. &lt;strong&gt;Apartamento 1G:&lt;/strong&gt; cuenta con 2 habitaciones dobles, 1 baño, cocina totalmente equipada y salón con TV. &lt;strong&gt;Apartamento 3G: &lt;/strong&gt;ofrece 2 habitaciones dobles, 1 baño, cocina totalmente equipada y salón con TV.&lt;br/&gt;
&lt;strong&gt;Otros:&lt;/strong&gt; posibilidad de instalar en cada apartamento una cama supletoria.&lt;br/&gt;
 &lt;br /&gt;

&lt;br&gt;&lt;b&gt;Ubicación: &lt;/b&gt;casa tradicional reformada situada en el núcleo urbano. Vivienda adosada a otros apartamentos turísticos ocupando la segunda planta del edificio. Conserva la piedra y madera originales.&lt;br/&gt;
&lt;b&gt;Entorno: &lt;/b&gt;pintoresco pueblo fronterizo con Francia, rodeado de los frondosos bosques del Pirineo navarro e inicio del Camino de Santiago.&lt;br/&gt;
&lt;b&gt;Distribución: &lt;/b&gt;consta de 2 habitaciones dobles, 1 baño, cocina totalmente equipada y salón-comedor con TV. Todas las estancias son abuhardilladas y con techo de madera. &lt;br/&gt;
 &lt;br /&gt; &lt;br /&gt;

&lt;strong&gt;Ubicación: &lt;/strong&gt;situado en el núcleo urbano.&lt;br /&gt;
&lt;strong&gt;Entorno: &lt;/strong&gt;Viana es la última población navarra de la Ruta Jacobea, fronteriza con La Rioja y a tan sólo 9 kilómetros de Logroño. Campos de cereales, viñas, almendros y olivares rodean a esta pequeña ciudad de más de 4.000 habitantes, marcada por el Camino de Santiago y el apogeo económico y cultural que vivió entre los siglos XVI y XVIII. De esa época encontramos interesantes ejemplos de arquitectura civil y religiosa.&lt;br /&gt;
&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 4 habitaciones dobles, 2 baños a compartir y salón-comedor con cocina.&lt;br /&gt;

&lt;br /&gt;&lt;b&gt;Ubicación: &lt;/b&gt;casa tradicional reformada situada en el barrio Igurin a las afueras del núcleo urbano. Vivienda  adosada a la del propietario ocupando la primera planta de edificio.&lt;br /&gt;&lt;strong&gt;Entorno:&lt;/strong&gt; pequeño pueblo de 400 habitantes situado en el valle de Malerreka, caracterizado por la abundancia de ríos y regatas, bosques de robles y hayas. Muy próximo al área natural recreativa de los embalses de Leurza, también se pueden realizar excursiones al Parque Natural de Bertiz o las cuevas de Zugarramurdi y Urdax.&lt;br /&gt;&lt;strong&gt;Distribución: &lt;/strong&gt;dispone de 4 habitaciones dobles, 2 baños a compartir con secador de pelo, salón con chimenea, TV, DVD, juegos y cocina totalmente equipada y TV. 3 de las habitaciones, la cocina, el salón y los 2 baños son accesibles a personas con discapacidad física.&lt;br /&gt;&lt;strong&gt;Otros: &lt;/strong&gt;terraza con mobiliario y barbacoa.&lt;br /&gt;
